
-- NeedleDrop Music Store (SLIM + Indexed FKs)
DROP DATABASE IF EXISTS needledrop;
CREATE DATABASE needledrop CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci;
USE needledrop;

CREATE TABLE country (country_id INT PRIMARY KEY AUTO_INCREMENT, name VARCHAR(64) NOT NULL UNIQUE) ENGINE=InnoDB;
CREATE TABLE label (label_id INT PRIMARY KEY AUTO_INCREMENT, name VARCHAR(128) NOT NULL UNIQUE, country_id INT NULL, website VARCHAR(255) NULL,
  CONSTRAINT fk_label_country FOREIGN KEY (country_id) REFERENCES country(country_id) ON UPDATE CASCADE ON DELETE SET NULL) ENGINE=InnoDB;
CREATE TABLE genre (genre_id INT PRIMARY KEY AUTO_INCREMENT, name VARCHAR(64) NOT NULL UNIQUE) ENGINE=InnoDB;
CREATE TABLE payment_method (payment_method_id INT PRIMARY KEY AUTO_INCREMENT, name VARCHAR(32) NOT NULL UNIQUE) ENGINE=InnoDB;
CREATE TABLE artist (artist_id INT PRIMARY KEY AUTO_INCREMENT, name VARCHAR(128) NOT NULL UNIQUE, formed_year SMALLINT NULL, country_id INT NULL,
  CONSTRAINT fk_artist_country FOREIGN KEY (country_id) REFERENCES country(country_id) ON UPDATE CASCADE ON DELETE SET NULL) ENGINE=InnoDB;
CREATE TABLE album (album_id INT PRIMARY KEY AUTO_INCREMENT, title VARCHAR(160) NOT NULL, artist_id INT NOT NULL, label_id INT NULL, release_date DATE NULL, upc CHAR(12) NULL,
  UNIQUE KEY uq_album_artist_title (artist_id, title),
  CONSTRAINT fk_album_artist FOREIGN KEY (artist_id) REFERENCES artist(artist_id) ON UPDATE CASCADE ON DELETE RESTRICT,
  CONSTRAINT fk_album_label FOREIGN KEY (label_id) REFERENCES label(label_id) ON UPDATE CASCADE ON DELETE SET NULL) ENGINE=InnoDB;
CREATE TABLE track (track_id INT PRIMARY KEY AUTO_INCREMENT, album_id INT NOT NULL, track_number INT NOT NULL, title VARCHAR(200) NOT NULL, genre_id INT NULL, composer VARCHAR(160) NULL, milliseconds INT NOT NULL, bytes INT NULL, unit_price DECIMAL(6,2) NOT NULL DEFAULT 0.99, preview_url VARCHAR(255) NULL,
  UNIQUE KEY uq_album_track (album_id, track_number),
  CONSTRAINT fk_track_album FOREIGN KEY (album_id) REFERENCES album(album_id) ON UPDATE CASCADE ON DELETE CASCADE,
  CONSTRAINT fk_track_genre FOREIGN KEY (genre_id) REFERENCES genre(genre_id) ON UPDATE CASCADE ON DELETE SET NULL) ENGINE=InnoDB;
CREATE TABLE employee (employee_id INT PRIMARY KEY AUTO_INCREMENT, first_name VARCHAR(40) NOT NULL, last_name VARCHAR(40) NOT NULL, title VARCHAR(60) NULL, reports_to INT NULL, hire_date DATE NOT NULL, email VARCHAR(100) NOT NULL UNIQUE, phone VARCHAR(30) NULL,
  CONSTRAINT fk_employee_reports_to FOREIGN KEY (reports_to) REFERENCES employee(employee_id) ON UPDATE CASCADE ON DELETE SET NULL) ENGINE=InnoDB;
CREATE TABLE customer (customer_id INT PRIMARY KEY AUTO_INCREMENT, first_name VARCHAR(40) NOT NULL, last_name VARCHAR(40) NOT NULL, company VARCHAR(100) NULL, email VARCHAR(100) NOT NULL UNIQUE, phone VARCHAR(30) NULL, address VARCHAR(100) NULL, city VARCHAR(40) NULL, state VARCHAR(40) NULL, postal_code VARCHAR(20) NULL, country_id INT NULL, support_rep_id INT NULL, created_at DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
  CONSTRAINT fk_customer_country FOREIGN KEY (country_id) REFERENCES country(country_id) ON UPDATE CASCADE ON DELETE SET NULL,
  CONSTRAINT fk_customer_support_rep FOREIGN KEY (support_rep_id) REFERENCES employee(employee_id) ON UPDATE CASCADE ON DELETE SET NULL) ENGINE=InnoDB;
CREATE TABLE invoice (invoice_id INT PRIMARY KEY AUTO_INCREMENT, customer_id INT NOT NULL, invoice_date DATETIME NOT NULL, billing_address VARCHAR(100) NULL, billing_city VARCHAR(40) NULL, billing_state VARCHAR(40) NULL, billing_postal_code VARCHAR(20) NULL, country_id INT NULL, payment_method_id INT NOT NULL, total DECIMAL(10,2) NOT NULL,
  CONSTRAINT fk_invoice_customer FOREIGN KEY (customer_id) REFERENCES customer(customer_id) ON UPDATE CASCADE ON DELETE RESTRICT,
  CONSTRAINT fk_invoice_country FOREIGN KEY (country_id) REFERENCES country(country_id) ON UPDATE CASCADE ON DELETE SET NULL,
  CONSTRAINT fk_invoice_payment FOREIGN KEY (payment_method_id) REFERENCES payment_method(payment_method_id) ON UPDATE CASCADE ON DELETE RESTRICT) ENGINE=InnoDB;
CREATE TABLE invoice_item (invoice_item_id INT PRIMARY KEY AUTO_INCREMENT, invoice_id INT NOT NULL, track_id INT NOT NULL, unit_price DECIMAL(6,2) NOT NULL, quantity INT NOT NULL DEFAULT 1,
  CONSTRAINT fk_invoiceitem_invoice FOREIGN KEY (invoice_id) REFERENCES invoice(invoice_id) ON UPDATE CASCADE ON DELETE CASCADE,
  CONSTRAINT fk_invoiceitem_track FOREIGN KEY (track_id) REFERENCES track(track_id) ON UPDATE CASCADE ON DELETE RESTRICT,
  UNIQUE KEY uq_invoice_track (invoice_id, track_id)) ENGINE=InnoDB;

-- Query helpers
CREATE INDEX ix_track_title ON track(title);
CREATE INDEX ix_album_title ON album(title);
CREATE INDEX ix_customer_last_first ON customer(last_name, first_name);
CREATE INDEX ix_invoice_date ON invoice(invoice_date);

-- Explicit FK indexes
CREATE INDEX ix_artist_country_id ON artist(country_id);
CREATE INDEX ix_label_country_id ON label(country_id);
CREATE INDEX ix_album_artist_id ON album(artist_id);
CREATE INDEX ix_album_label_id ON album(label_id);
CREATE INDEX ix_track_album_id ON track(album_id);
CREATE INDEX ix_track_genre_id ON track(genre_id);
CREATE INDEX ix_customer_country_id ON customer(country_id);
CREATE INDEX ix_customer_support_rep_id ON customer(support_rep_id);
CREATE INDEX ix_invoice_customer_id ON invoice(customer_id);
CREATE INDEX ix_invoice_country_id ON invoice(country_id);
CREATE INDEX ix_invoice_payment_method_id ON invoice(payment_method_id);
CREATE INDEX ix_invoice_item_invoice_id ON invoice_item(invoice_id);
CREATE INDEX ix_invoice_item_track_id ON invoice_item(track_id);

CREATE OR REPLACE VIEW v_track_details AS
SELECT t.track_id, t.title AS track_title, a.title AS album_title, ar.name AS artist_name, g.name AS genre, t.milliseconds, t.unit_price AS base_unit_price
FROM track t
JOIN album a ON a.album_id = t.album_id
JOIN artist ar ON ar.artist_id = a.artist_id
LEFT JOIN genre g ON g.genre_id = t.genre_id;

CREATE OR REPLACE VIEW v_invoice_summary AS
SELECT i.invoice_id, i.invoice_date, CONCAT(c.first_name, ' ', c.last_name) AS customer_name, pm.name AS payment_method, i.total
FROM invoice i
JOIN customer c ON c.customer_id = i.customer_id
JOIN payment_method pm ON pm.payment_method_id = i.payment_method_id;

DELIMITER //
DROP PROCEDURE IF EXISTS sp_top_customers//
CREATE PROCEDURE sp_top_customers(IN p_limit INT)
BEGIN
  SELECT c.customer_id, CONCAT(c.first_name,' ',c.last_name) AS customer_name, SUM(i.total) AS lifetime_value
  FROM customer c
  JOIN invoice i ON i.customer_id = c.customer_id
  GROUP BY c.customer_id
  ORDER BY lifetime_value DESC
  LIMIT p_limit;
END//
DELIMITER ;

DELIMITER //
CREATE TRIGGER trg_invoice_item_after_ins
AFTER INSERT ON invoice_item
FOR EACH ROW
BEGIN
  UPDATE invoice SET total = (
    SELECT IFNULL(SUM(unit_price * quantity),0) FROM invoice_item WHERE invoice_id = NEW.invoice_id
  ) WHERE invoice_id = NEW.invoice_id;
END//
CREATE TRIGGER trg_invoice_item_after_upd
AFTER UPDATE ON invoice_item
FOR EACH ROW
BEGIN
  UPDATE invoice SET total = (
    SELECT IFNULL(SUM(unit_price * quantity),0) FROM invoice_item WHERE invoice_id = NEW.invoice_id
  ) WHERE invoice_id = NEW.invoice_id;
END//
CREATE TRIGGER trg_invoice_item_after_del
AFTER DELETE ON invoice_item
FOR EACH ROW
BEGIN
  UPDATE invoice SET total = (
    SELECT IFNULL(SUM(unit_price * quantity),0) FROM invoice_item WHERE invoice_id = OLD.invoice_id
  ) WHERE invoice_id = OLD.invoice_id;
END//
DELIMITER ;

SET FOREIGN_KEY_CHECKS=0;
SET FOREIGN_KEY_CHECKS=1;
